import { StyleSheet } from "aphrodite";
const styles = StyleSheet.create({
  photos_wrapper: {
      display: 'flex',
      flexDirection: "column",
      justifyContent: 'center',
      alignSelf: 'center'
  },
  photos_p:{
      alignSelf: 'center',
      marginBottom: '20px',
      width: '100%'
  },
  p2:{
      width: '70%'
  }
});
export default styles;
